export function Logo() {
  const { resolvedTheme } = useTheme();
  return (
    <div className="flex items-center gap-4">
      <Link
        className="hidden md:block transition-opacity hover:opacity-70"
        href="/"
      >
        {resolvedTheme === "dark" ? <LogoDark /> : <LogoLight />}
      </Link>
    </div>
  );
}
